import React from "react";
import "./Blackbox.css";

function Blackbox() {
  return (
    <div className="blackbox">
      <h3 className="whitetext">Let's Consult Your Health With Our Doctor</h3>
      <div className="blackbox-inner">
        <span className="span14">we will provide the best service.</span>
        <div className="btn_login">
          <a href="#" className="btn_log">
            Contact Us
          </a>
        </div>
      </div>
    </div>
  );
}

export default Blackbox;
